import React from 'react';

const Pricing = ({ data }) => {
  return (
    <section className="pricing">
      {data.map((plan, index) => (
        <div key={index} className="pricing-plan">
          <h3>{plan.plan}</h3>
          <p>{plan.price}</p>
          <ul>
            {plan.features.map((feature, i) => (
              <li key={i}>{feature}</li>
            ))}
          </ul>
        </div>
      ))}
    </section>
  );
};

export default Pricing;
